            <span>ID :</span>
            <input className='ID_KEY' type="text" placeholder="腾讯云ID" id="myID" /> 
            <span>KEY :</span>
            <input className='ID_KEY' type="password" placeholder="腾讯云KEY" id="myKEY"/>
            </div>
            <button className='button' style={{ fontSize: '0.8em' }} id="save_id_key" onClick={saveToLocalStorage}>保存ID和KEY</button>
        </div>
    )
}
